import { Component } from '@angular/core';
import { region } from 'src/app/helper/region-helper';
import { PokemonComponent } from 'src/app/pokemon/pokemon.component';

@Component({
  selector: 'app-regions',
  templateUrl: './regions.component.html',
  styleUrls: ['./regions.component.scss']
})
@Injectable
export class RegionsComponent {
  constructor(private pokemon: PokemonComponent){}
  listPokemon: any
  getRegionPokemons():any {
      const firstPokemon = region['kanto'].firstPokemon
      const lastPokemon = region['kanto'].lastPokemon
      for (let i = firstPokemon; i <= lastPokemon; i++){
        this.listPokemon.push(this.pokemon.getPokemonDetails(i.toString()))
      }
    return this.listPokemon
  }
}
